import React from 'react'
import Dashboard from '../Dashboard'
import {Button} from 'react-bootstrap'
import styled from 'styled-components'
import ProgramCard from '../../cards/ProgramCard'

export default function IndivMovie() {
    return (
        <>
            <Dashboard/>
            <div>
                <Top>
                    <Image><img style={{width: "250px", height: "350px"}} src="https://m.media-amazon.com/images/M/MV5BMTQzMzg1ODAyNl5BMl5BanBnXkFtZTYwMjAxODQ1._V1_SX150_CR0,0,150,150_.jpg" alt=""/></Image>
                    <div style={{marginLeft: "50px"}}>
                        <Title><h1>Lord of the Rings: The Fellowship of the Ring</h1></Title>
                        <div>
                            <Text><h3>Type: Movie</h3></Text>
                            <Text><h3>Age-Rating: 14A</h3></Text>
                            <Text><h3>Year: 2001</h3></Text>
                            <Text><h3>Genre: Fantasy/Adventure</h3></Text>
                            <Text><h3>Language: English</h3></Text>
                            <Text><h3>Streaming Service: Netflix</h3></Text>
                            <Text><h3>Duration: 3h 48m</h3></Text>
                            <Text><h3>Arrival Date: March 28, 2018</h3></Text>
                            <Text><h3>Departure Date: March 28, 2021</h3></Text>
                        </div>
                    </div>
                </Top>
                <AddFavBtn><Button>Add To Favourites</Button></AddFavBtn>
                <Header><h2>Programs</h2></Header>
                <Scroll><ProgramCard/></Scroll>
            </div>

        </>
    )
}

const Top = styled.div`
    display: flex; 
    margin-top: 50px;
    margin-left: 180px; 
`
const Title = styled.div `
    margin-right: 0px; 
    margin-bottom: 20px; 
`
const Text = styled.div `
    margin-left: 30px; 
    margin-top: 0px; 
    margin-bottom: 10px; 
`

const Header = styled.div`
    margin-left: 240px; 
    margin-top: 50px;
`
const Image = styled.div` 
margin-left: 90px; 
    margin-right: 0px;   
`
const AddFavBtn = styled.div `
    margin-left: 270px; 
    margin-top: 20px;
`

const Scroll = styled.div`
    height: 400px; 
    padding-bottom: 50px; 
    overflow: hidden; 
    overflow-y: auto; 
`
